(11, 'cricket', 'Cricket is a bat-and-ball game played between two teams of eleven players on a field at the centre of which is a 22-yard (20-metre) pitch with a wicket at each end, each comprising two bails balanced on three stumps. The batting side scores runs by striki', 'Best Cricket Blogs Websites.jpg', '2023-01-11 07:36:20', '2023-01-11 07:36:20', '1', 'Cricket is a bat-and-ball game played between two teams of eleven players on a field at the ... For example, a team that passes its opponents\' total having lost six ...', 26),
(12, 'hocky', 'Hockey is a term used to denote a family of various types of both summer and winter team sports which originated on either an outdoor field, sheet of ice, or dry floor such as in a gymnasium. While these sports vary in specific rules, numbers of players, ', '800px-Field_hockey_at_the_2012_Summer_Olympics_-_NZL-AUS_(7796665032).jpg', '2023-01-11 07:38:10', '2023-01-11 07:38:10', '1', 'Hockey is a term used to denote a family of various types of both summer and winter team sports which originated on either an outdoor field,', 26),
(13, 'golf', 'Golf, unlike most ball games, cannot and does not use a standardized playing area, and coping with the varied terrains encountered on different courses is a key part of the game. Courses typically have either 18 or 9 holes, regions of terrain that each co', 'Golfer_swing.jpg', '2023-01-11 07:40:32', '2023-01-11 07:40:32', '1', 'Golf is a club-and-ball sport in which players use various clubs to hit balls into a series of holes on a course in as few strokes as possible.', 26),
(14, 'Volleyball', 'Volleyball is a team sport in which two teams of six players are separated by a net. Each team tries to score points by grounding a ball on the other team\'s court under organized rules.[1] It has been a part of the official program of the Summer Olympic G', '260px-Algeria_and_Japan_women\'s_national_volleyball_team_at_the_2012_Summer_Olympics_(7913959028).webp', '2023-01-11 07:43:10', '2023-01-11 07:43:10', '1', 'Volleyball is a team sport in which two teams of six players are separated by a net. Each team tries to score points by grounding a ball on the other team\'s court under organized rules.', 26);
