(5, 'contact us', 'contact_us', 'Get this image on: istockphoto.com | Licence details\r\nCreator: marchmeena29 \r\n| \r\nCredit: Getty Images/iStockphoto\r\nWant to know where this information comes from? Learn more\r\n', 'istockphoto-1168945108-612x612.jpg', 1, '2023-01-09 09:07:25', '2023-01-10 06:19:50'),
(6, 'About us', 'about_us', 'Let’s start by saying that using images doesn’t mean that we want you “dress up” your post with cute pictures that take away from the message you’re trying to get across. When used right, images can help readers better understand your content. Like it’s been said a few times before, a picture is worth a thousand words. And although this probably doesn’t apply to Google, it can apply to your readers. If a visitor has to choose which site to visit on Pinterest or Facebook, they will choose one with an image that’s compelling to them. Sure, your call to action or social text will have to persuade them as well, but if you don’t use high-quality images, they very well might skip your blog post.', 'Blog_images_FI.avif', 0, '2023-01-10 05:47:54', '2023-01-10 06:22:13');
